import styled from 'styled-components';
import Item from '../components/Item';

const Layout = styled.div`
  display: flex;
  flex-direction: column;
`;

const TotalForm = styled.div`
  display: flex;
  flex-direction: column;
`;

const Home = () => {
  return (
    <Layout>
      <h1>Grocery Calculator</h1>
      <TotalForm>
        <label>
          Total (including tax): <input type='text' name='name' />
        </label>
        <label>
          Tax: <input type='text' name='name' />
        </label>
        <button>Submit</button>
      </TotalForm>
      <h2>Sawyer Deductions</h2>
      <p>enter prices of items to be removed from Sawyer's total</p>
      <Item price={3.75} />
    </Layout>
  );
};

export default Home;
